function Productlisting() {
  const [search, setSearch] = useState("");
  const [filteredData, setFilteredData] = useState(imagedata);
  const [cartItems, setCartItems] = useState([]);
  const [showCart, setShowCart] = useState(false);

  const handleSearch = () => {
    const results = imagedata.filter((item) =>
      item.name.toLowerCase().includes(search.toLowerCase())
    );
    setFilteredData(results);
  };

  const handleAddToCart = (item) => {
    const existing = cartItems.find((cartItem) => cartItem.name === item.name);
    if (existing) {
      setCartItems(
        cartItems.map((cartItem) =>
          cartItem.name === item.name
            ? { ...cartItem, quantity: cartItem.quantity + 1 }
            : cartItem
        )
      );
      } else {
      setCartItems([...cartItems, { ...item, quantity: 1 }]);
    }
  };

  return (
    <Box sx={{ backgroundColor: "#f0f2f5", minHeight: "100vh",border:"1px solid black",width:"1200px", py: 5 }}>
      <Container maxWidth="lg">
        <Typography variant="h4" align="center" gutterBottom>
          {showCart ? "Your Cart" : "Gadgets"}
        </Typography>

        <Box display="flex" justifyContent="center" alignItems="center" mb={5}>
          {!showCart && (
            <>
              <TextField
                size="small"
                label="Search Gadgets"
                variant="outlined"
                fontFamily="poppins"
                value={search}
                onChange={(e) => setSearch(e.target.value)}
                sx={{ width: 300, mr: 3 }}
              />
              <Button variant="contained" onClick={handleSearch}>
                Search
              </Button>
            </>
          )}
          <Button
            variant="outlined"
            onClick={() => setShowCart(!showCart)}
            sx={{ ml: 2 }}
            
          >
            {showCart ? "Back to Products" : `Cart (${cartItems.length})`}
          </Button>
        </Box>

        {showCart ? (
          <Grid container spacing={4}>
            {cartItems.length === 0 ? (
              <Typography textAlign="center" width="100%" fontFamily="poppins" fontWeight={"bold"} fontSize={"large"}>
                Your cart is empty.
              </Typography>
            ) : (
              cartItems.map((item, index) => (
                <Grid item xs={12} sm={6} md={4} key={index}>
                  <Card sx={{ backgroundColor: "#ffffff", p: 2 }}>
                    <CardMedia
                      component="img"
                      image={item.image}
                      alt={item.name}
                      sx={{ height: 140, objectFit: "contain" }}
                    />
                    <CardContent>
                      <Typography variant="h6" fontFamily={"poppins"} fontWeight={"bold"}>{item.name}</Typography>
                      <Typography fontFamily={"poppins"}> Price: {item.price}</Typography>
                      <Typography fontFamily={"poppins"}> Quantity: {item.quantity}</Typography>
                      <Typography fontFamily={"poppins"}> Total: {item.price * item.quantity}</Typography>
                    </CardContent>
                  </Card>
                </Grid>
              ))
            )}
          </Grid>
        ) : (
          <Grid container spacing={5}>
            {filteredData.map((item, index) => (
              <Grid item xs={12} sm={6} md={4} lg={3} key={index}>
                <Card
                  sx={{
                    backgroundColor: "#ffffff",
                    p: 2,
                    transition: "transform 0.3s ease",
                    "&:hover": { transform: "scale(1.05)" },
                  }}
                >
                  <CardMedia
                    component="img"
                    image={item.image}
                    alt={item.name}
                    sx={{
                      height: 100,
                      objectFit: "contain",
                      mb: 1,
                    }}
                  />
                  <CardContent sx={{ textAlign: "center" }}>
                    <Typography sx={{ fontWeight: 800 }} fontFamily={"poppins"}>{item.name}</Typography>
                    <Typography sx={{ fontSize: 15 }} fontFamily={"poppins"}>{item.price}</Typography>

                    <Button
                      variant="contained"
                      size="small"
                      fontFamily="poppins"
                      onClick={() => handleAddToCart(item)}
                      sx={{ mt: 1 }}
                    >
                      Add to Cart
                    </Button>
                  </CardContent>
                </Card>
              </Grid>
            ))}
          </Grid>
        )}
      </Container>
    </Box>
  );
}

